vs/workbench/contrib/terminal/common/ter.terminal.integrated.commandsToSkipShell:
一组命令 ID，其键绑定将不发送至 shell，而是始终由 VS Code 进行处理。这样的话，通常由 shell 使用的键绑定的行为可如同焦点未在终端上时的行为一样，例如按 “Ctrl+P” 来启动“快速打开”。

&nbsp;

默认跳过多项命令。要替代默认值并转而将相关命令的键绑定传递给 shell，请添加以 “-” 字符为前缀的命令。例如，添加“-workbench.action.quickOpen” 可使 “Ctrl+P”到达 shell。

&nbsp;

在设置编辑器中查看时，下面的默认跳过命令列表会被截断。要查看完整列表，请[打开默认设置 JSON](command:workbench.action.openRawDefaultSettings“打开默认设置(JSON)”)，然后从下面的列表中搜索第一个命令。

